import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import DomainForm from "../components/DomainForm";
import { Card } from "../components/ui/card";
import { Button } from "../components/ui/button";
import { useToast } from "../components/ui/use-toast";
import { Alert, AlertDescription, AlertTitle } from "../components/ui/alert";
import { InfoIcon } from "lucide-react";
import { DEFAULT_CONFIG } from "../utils/constants";

export default function Domain() {
  const [loading, setLoading] = useState(true);
  const [config, setConfig] = useState(null);
  const [error, setError] = useState(null);
  const navigate = useNavigate();
  const { toast } = useToast();

  useEffect(() => {
    // Load saved configuration
    try {
      const savedConfig = localStorage.getItem("wrf_config");
      if (savedConfig) {
        const parsedConfig = JSON.parse(savedConfig);
        setConfig(parsedConfig);
      } else {
        setConfig(DEFAULT_CONFIG);
      }
    } catch (err) {
      console.error("Error loading configuration:", err);
      setError("配置加载失败，请刷新页面重试");
      setConfig(DEFAULT_CONFIG);
    } finally {
      setLoading(false);
    }
  }, []);

  const handleDomainSubmit = (domainData) => {
    try {
      // Update only the domain section of the config
      const updatedConfig = {
        ...config,
        domain: domainData
      };

      // Save to localStorage
      localStorage.setItem("wrf_config", JSON.stringify(updatedConfig));
      setConfig(updatedConfig);

      toast({
        title: "成功",
        description: "区域配置已保存",
      });
    } catch (err) {
      console.error("Error saving domain configuration:", err);
      toast({
        title: "错误",
        description: "保存配置失败",
        variant: "destructive",
      });
    }
  };

  const goBack = () => {
    navigate("/time");
  };

  const goToPhysics = () => {
    navigate("/physics");
  };

  if (loading) {
    return (
      <div className="container mx-auto py-8">
        <Card className="w-full max-w-5xl mx-auto p-6">
          <div className="flex justify-center items-center h-60">
            <p className="text-lg text-muted-foreground">加载配置中...</p>
          </div>
        </Card>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container mx-auto py-8">
        <Alert variant="destructive" className="mb-6">
          <InfoIcon className="h-4 w-4" />
          <AlertTitle>配置错误</AlertTitle>
          <AlertDescription>{error}</AlertDescription>
        </Alert>
        <Card className="w-full max-w-5xl mx-auto p-6">
          <Button onClick={goBack}>返回上一步</Button>
        </Card>
      </div>
    );
  }

  return (
    <div className="container mx-auto py-8">
      <div className="space-y-6 max-w-5xl mx-auto">
        <div>
          <h1 className="text-3xl font-bold">模拟区域设置</h1>
          <p className="text-muted-foreground mt-1">
            配置模拟区域的网格和地理位置信息
          </p>
        </div>

        <Alert>
          <InfoIcon className="h-4 w-4" />
          <AlertTitle>区域设置提示</AlertTitle>
          <AlertDescription>
            确保您的模拟区域足够大以包含感兴趣的现象，但也要考虑计算资源的限制。
            网格间距直接影响模拟精度和计算时间。
          </AlertDescription>
        </Alert>

        <DomainForm 
          onSubmit={handleDomainSubmit} 
          defaultValues={config.domain || {}} 
        />

        <div className="flex justify-between pt-4">
          <Button variant="outline" onClick={goBack}>
            返回时间设置
          </Button>
          <Button 
            onClick={goToPhysics}
            disabled={!config?.domain}
          >
            下一步：物理过程
          </Button>
        </div>
      </div>
    </div>
  );
}
